Simplifying MongoDB aggregation $project stage<p>I have the following working <code>$project</code> stage in my MongoDB aggregation pipeline. The issue is that I am not fully happy with it and would like to hear your suggestions on how the stage could be improved:</p>
<pre><code>$project: {
    _id: 0,
    name: 1,
    points: 1,
    level: {
        $cond: {
            if: { $gt: [ &quot;$points&quot;, 250 ] },
            then: {
                $cond: {
                    if: { $gt: [ &quot;$points&quot;, 500 ] },
                    then: {
                        $cond: {
                            if: { $gt: [ &quot;$points&quot;, 3000 ] },
                            then: {
                                $cond: {
                                    if: { $gt: [ &quot;$points&quot;, 5000 ] },
                                    then: {
                                        $cond: {
                                            if: { $gt: [ &quot;$points&quot;, 20000 ] },
                                            then: 6,
                                            else: 5
                                        }
                                    },
                                    else: 4
                                }
                            },
                            else: 3
                        }
                    },
                    else: 2
                }
            },
            else: 1
        }
    }
}
</code></pre>
<p>Basically, what the project stage does is compute a certain <code>level</code> (1-6), based on achieved <code>points</code>. Right now it looks really hard to read and error prone, any suggestions on how to improve would be welcome.</p>

