How to get a field from another collection and replace with null if not found?<p>I have following shcemas:</p>
<pre class="lang-js prettyprint-override"><code>employeeSchema: {
     _id: ObjectId
     isActive: Boolean
}
</code></pre>
<pre class="lang-js prettyprint-override"><code>careerSchema: {
    employeeId: ObjectId // points to the _id from employeeSchema
    isCurrentlyWorking: Boolean
    position: String // designation
}
</code></pre>
<p>I want to find the employees that have field <code>isActive: true</code>. Also, the same employee may have more than one document in the Career collection. I want to find the document with <code>isCurrentlyWorking: true</code> and want that document's <code>position</code> field to be in the employee document's <code>career</code> field. I have tried the following:</p>
<pre class="lang-js prettyprint-override"><code>const result = await Employee.aggregate([
    { $match: { isActive: true } },
    {
         from: &quot;careers&quot;,
         localField: &quot;_id&quot;,
         foreignField: &quot;employeeId&quot;,
         as: &quot;career&quot;,
         pipeline: [
             { $match: { isCurrentlyWorking: true} },
             { $project: { position: 1} }
         ]
    }
])
</code></pre>
<p>The problem that I have faced with this is the field <code>career</code> is an empty array in the <code>result</code>. And because of that I cannot add <code>{ $unwind: &quot;$career&quot; }</code> to the aggregate function. One more thing, some employees may not have any correspoding document in the <code>Careers</code> collection. In that case, I just want the <code>result</code> to have <code>career: null</code>.</p>

