How to merge two collections and let result end up in user defined field?<p>Suppose I have two collections: one main collection and one collection containing meta data. The meta data has additional (volatile) data that I don't want to have in my main collection.</p>
<p>What I'd like to do next is to merge this meta data with the main collection. This is possible since they both use the same <code>_id</code>. However I don't want all meta data to end up in the main document, I want to to end up in a field named <code>meta</code>. Like this:</p>
<pre class="lang-js prettyprint-override"><code>// Main record
{
  _id: 1234,
  varA: &quot;foo&quot;,
  varB: &quot;bar&quot;
}

// Meta record
{
  _id: 1234,
  metaA: &quot;cafe&quot;,
  metaB: &quot;babe&quot;
}
</code></pre>
<p>The merge should end up with</p>
<pre><code>// Merged record
{
  _id: 1234,
  varA: &quot;foo&quot;,
  varB: &quot;bar&quot;,
  meta:
  { 
    metaA: &quot;cafe&quot;,
    metaB: &quot;babe&quot;
  }
}
</code></pre>
<p>Obviously I could manually iterate through all documents and combine them myself, but that's slow and I'm sure this can be solved using aggregation stages.</p>
<p>I already tried various options of <code>$merge</code>, all to no avail. If anyone has an idea, please let me know.</p>
<p>Thanks!</p>

